import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      <nav className="mainMenu">
        <NavLink to="/" className="menu_link">
          Home
        </NavLink>
        <NavLink to="/contact"> Contact Us</NavLink>
      </nav>
    </>
  );
};

export default Navbar;
